        winDif = int(request.form.get("WinDif"))
        pointDif = int(request.form.get("PointDif"))
        interceptionDif = int(request.form.get("InterceptionDif"))
        sackDif = int(request.form.get("SackDif"))
        ypDif = int(request.form.get("YPDif"))
        possessionDif = int(request.form.get("PossessionDif"))
        penaltyDif = int(request.form.get("PenaltyDif"))
        fdDif = int(request.form.get("FDDif"))
        rushDif = int(request.form.get("RushDif"))
        passDif = int(request.form.get("PassDif"))
        tyDif = int(request.form.get("TYDif"))
        turnoverDif = int(request.form.get("TurnoverDif"))

        totalSum = (winDif + pointDif + interceptionDif + sackDif + ypDif + possessionDif  + penaltyDif 
            + fdDif + rushDif + passDif + tyDif + turnoverDif)
                
        winWeight = (winDif/totalSum)
        pointWeight = (pointDif/totalSum)
        interceptionWeight = (interceptionDif/totalSum)
        sackWeight = (sackDif/totalSum)
        ypWeight = (ypDif/totalSum)
        possessionWeight = (possessionDif/totalSum)
        penaltyWeight = (penaltyDif/totalSum)
        fdWeight = (fdDif/totalSum)
        rushWeight = (rushDif/totalSum)
        passWeight = (passDif/totalSum)
        tyWeight = (tyDif/totalSum)
        turnoverWeight = (turnoverDif/totalSum)

        weightedWinY = [[z * winWeight for z in y] for y in winY]
        weightedPointY = [[z * pointWeight for z in y] for y in pointY]    
