        weightedTyY = [[z * tyWeight for z in y] for y in tyY] 
        weightedTurnoverY = [[z * turnoverWeight for z in y] for y in turnoverY]

        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedWinY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedPointY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedInterceptionY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedPointY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedSackY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedYpY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedPossessionY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedPenaltyY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedFdY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedRushY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedPassY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedTyY, sumY)]
        sumY = [[i1+j1 for i1, j1 in zip(i,j)] for i, j in zip(weightedTurnoverY, sumY)]

        return render_template("index.html", title="NFL Rank")

